import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="home">
        <header className="home-header">
          { <img src={image.jpg} className="home-logo" alt="limage.jpg" /> }
          <h1 className="home-title">Welcome to Sports activities finder</h1>
        </header>


      </div>
    );
  }
}

export default App;
